	('phone', 'taobao', NULL, 'AEKU', 'AEKU I9', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 3, 85, 34, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	('phone', 'taobao', NULL, 'AEKU', 'AEKU M5', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 28, 85, 84, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	('phone', 'taobao', NULL, 'AEKU', 'AEKU A5', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 7, 128, 23, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	('phone', 'taobao', NULL, 'AEKU', 'AEKU C9', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9, 128, 10, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	('phone', 'taobao', NULL, 'AEKU', 'AEKU I6', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 4, 114, 26, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	('phone', 'taobao', NULL, 'AEKU', 'AEKU Q2', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 3, 94, 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	('phone', 'taobao', NULL, 'AEKU', 'AEKU C8', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 4, 88, 17, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	('phone', 'taobao', NULL, 'AEKU', 'AEKU Q5', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 198, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	('joke', 'qiushibaike', '120904998', '学校里冬天的厕所比夏天好太多了。所有的脏物都被风干了。没有污水横流，没有白色蠕动的小东西，也没有刺鼻的氨水味。\n     <br>\n     <br>美中不足就是坑里有时会堆的太高，毕竟不流动了嘛！再就是厕所漏风，屁.股冻的有点冷。\n     <br>\n     <br>于是同学们上次厕所都会带好多纸，蹲下后，烧上几张，一是暖暖坑，再就是加热下好让堆高的东西流下去点。\n     <br>\n     <br>一边烧一边拉，一大乐事也。\n     <br>\n     <br>我那天早上就是这样美滋滋的拉着。可能是毛线裤掉下个线头，不知怎么就天雷勾地火的点着了。\n     <br>\n     <br>当时全校师生在做早操，就见我从厕所狂奔而出，一边发出惊天的惨叫，一边胡乱的拍打。\n     <br>\n     <br>白花花的屁股像一道闪电划过所有人的眼睛。\n     <br>\n     <br>老师们立马冲上去，终于给扑灭了……\n     <br>\n     <br>多年后，当我看到〈大话西游〉，给星爷灭火的场景时，我沉默的点了根烟喃喃自语道：那天的情形，大抵如是…', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 827, 22, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	('joke', 'qiushibaike', '120941398', '网吧认识一个小兄弟，留着长碎发人比较清秀腼腆。\n     <br>因为都喜欢玩游戏，所以经常勾肩搭背相谈甚欢。\n     <br>就在昨晚他跟我表白了，我一脸懵 逼的看着他:兄弟别逗了，哥取向正常，只喜欢妹子。\n     <br>他满脸通红的站起来拍着胸 口说:我是妹子真的是妹子，不信你看我有 胸！\n     <br>我望着他那微微隆起的胸 肌:你是妹子？这个抱歉，我真没看出来！\n     <br>他…', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 992, 31, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	('joke', 'qiushibaike', '120940745', '家里搬新家，全部换了新家具，看了爸妈房间的床，再看弟弟房间的床，他们都是宽大的席梦思，就我房间是一张上下铺的床。\n     <br>我问我妈:怎么你们房间的床跟我的不一样，我妈说:等你嫁出去以后，这床就可以留给你弟以后小孩用，省事还省钱呢！\n     <br>我。。', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 3269, 46, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	('joke', 'qiushibaike', '120535448', '转帖：半夜加班发生的恐怖事件\n     <br>------------------------------------------------------\n     <br>安全到家必须得发个朋友圈 太惊险了\n     <br>历时1小时10分钟的回家的路总算到家了\n     <br>司机困得不行不行不行不行的了\n     <br>在京承高速开50的速度 到了六环就开40的速度了 而且开一会儿就压线了 骑着线走 骑着应急车道线走没那么紧张 但是骑着中间线走那就相当紧张了\n     <br>司机一会儿摸摸自己的头 一会儿喊一嗓子 一会儿一只手打打拳 一会儿耸耸肩 一会儿把音乐音量开最大\n     <br>终于坚持到下高速 但是在高速收费站等待的那几秒钟睡着了 Anyway最终我活着到家', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 216, 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	('joke', 'qiushibaike', '120940989', '……在男友家玩儿，男友侄子非让我教他玩游戏，我跟他说都开学了，必须把精力放在学习上。。小家伙看再三求我也没用，于是笑着说“好吧，我听你的，要不然你陪我玩猜猜看游戏。。”\n     <br>小家伙抱出来一堆东西，指着一瓶护肤品问谁的，我说你妈妈的，他又拿出一件衣服问我，我说你奶奶的，……\n     <br>突然小家伙对着男友妈妈喊“奶奶，叔叔女朋友骂我‘你奶奶的’”\n     <br>我…', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1749, 32, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	('joke', 'qiushibaike', '120936196', '中午和老妈视频，谈到接送小侄子上学的问题，她说现在学前班的小孩得接送\n     <br>我说:小时候我们从来没接送过\n     <br>老妈说:你们那时候，恨不得有人捡走一个[哀怨][哀怨][哀怨', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1369, 10, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	('joke', 'qiushibaike', '120934910', '下班回家，路上突然感觉内衣带掉下肩膀，就用手整理一下！刚收手，旁边一个美女啪的一巴掌打在她老公脸上：有啥好看的，老娘没有吗？\n     <br>然后转身一脸怒气的问我：咋滴，胸.大了不起了？老娘现在就去隆.个比你这还大十倍的！\n     <br>卧槽，，', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 3679, 118, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	('joke', 'qiushibaike', '120887593', '正吃着饭，娃“噗”放个屁，我皱着眉头说她:“尊重一下大家，正吃饭呢，你放什么屁啊！”娃竟然跟我顶嘴:“本来是我自己的屁，你把它拿到饭桌上说，是你不尊重大家，不是我，，', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 4274, 36, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	('joke', 'qiushibaike', '120537065', '看到一则悬赏通告，说嫌疑人留山羊胡，操不标准普通话，左侧手臂外侧有香烟烫疤，携带一本算命书，内藏一把尖刀，擅长放牧，捡垃圾，打工……实在想不通，这是怎样一个人，尤其那本算命书，难道他认为命里该剥夺他人性命？真不懂他极端的思', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 184, 4, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	('joke', 'qiushibaike', '120936559', '两个女同事都姓郭，年龄相差十多岁，她们关系特别好，经常一起逛街。有一天就偶遇了我们单位的马姐带着在读研究生儿子。马姐跟儿子介绍说:这两位是妈妈单位的同事，，，\n     <br>她儿子礼貌地说:阿姨好！\n     <br>大郭姐神色如常，应了一声，小郭妹吓了一跳', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1217, 14, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	('joke', 'qiushibaike', '120938892', '家里来客人了，我在饭店烧了一只鸡，然后自己又在家炒了四个菜一个汤，美滋滋的拍张照发了个朋友圈，好多朋友给我评论，\n     <br>朋友1:那个鸡烧的不错。\n     <br>朋友2:哇⊙∀⊙！鸡不错。\n     <br>朋友3:厨艺大涨啊，鸡烧的跟饭店里买的似的…', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1080, 29, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	('joke', 'qiushibaike', '120942187', '工地狗一枚，我们施工办公室没安空调，甲方领导下来视察工作后，便在我们的办公室开了会，会后我便拿了些资料给领导签字，领导说太热了，他中暑了，让我明天拿到公司去签，可能觉得公司远，有点不好意思，就补充说了句:你就不热啊？，我:热啊，只是我没资格中暑', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2057, 16, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	('joke', 'qiushibaike', '120846917', '刚刚四排吃鸡\n     <br>遇到三个小朋友\n     <br>我就问了句暑假作业写完了没\n     <br>这三个熊孩子就用手雷把我炸死了\n     <br>[中毒了][中毒了][中毒了][中毒了][中毒了][中毒了][中毒了][中毒了][中毒了][中毒了', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1471, 23, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	('joke', 'qiushibaike', '120941870', '从小养成了碗里不剩饭的习惯，一直以来，去哪吃饭都是吃的干干净净。\n     <br>第一次去男友家，习惯性的把碗里的饭吃的一粒不剩，男友妈妈以为我没吃饱，让我再盛饭。因为已经饱了，所以没再盛，阿姨则认为我是不好意思。\n     <br>后来再去他家，我就有了一个专属的不锈钢大碗！', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1929, 43, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	('joke', 'qiushibaike', '120936709', '我的手机是千元以下，用过两年的，反应超级慢，刚才我看完糗事，返回，放到桌子上，看见屏幕上有根头发，就吹了一下。\n     <br>这时手机适时返回了主页，把旁边的小伙伴看呆了', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 3652, 34, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	('joke', 'qiushibaike', '120942808', '年轻时，看有文章称，接.吻时，眼睛大都是闭上的！\n     <br>一直半信半疑，直到我有了女朋友……\n     <br>我才知道说得真特么对，离得那么近，不闭上眼睛真心下不去口', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1477, 33, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `bigdata_t` (`type_id`, `src`, `s0`, `s1`, `s2`, `s3`, `s4`, `s5`, `s6`, `s7`, `s8`, `s9`, `v0`, `v1`, `v2`, `v3`, `v4`, `v5`, `v6`, `v7`, `v8`, `v9`, `v10`, `v11`, `v12`, `v13`, `v14`, `v15`, `v16`, `v17`, `v18`, `v19`) VALUES
	('joke', 'qiushibaike', '120941376', '本人家住偏远小城，今天出门打车，五分钟左右的路，司机“这位乘客，我带你抄个小路吧，快得很！”\n     <br>20分钟以后......\n     <br>“姑娘你还记得路咋走的吗？我咋绕的有点糊涂..', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 3098, 36, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	('joke', 'qiushibaike', '120537461', '都说相亲的事，说个我去年相亲的事吧，本人大学期间热爱体育，比较女汉子，在寝室给她们提暖瓶，拧瓶盖，逛街的时候给她们提衣服鞋子，这是背景，和一个相亲对象在一个鱼粉店吃鱼粉，买了两瓶水，因为天比较热，我把自己的瓶盖拧开了，看他没动，于是手贱的把他瓶盖也拧开了，，，，永远也忘不了他看我的眼神，于是他就成为我相亲对象中唯一记得长相的一', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2278, 72, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	('joke', 'qiushibaike', '120936243', '闺蜜云云正在谈婚论嫁，我一次去医院无意中看到她男朋友挂男科专家号，回来我郑重的约云云出来谈心，劝她为了幸福着想，慎重考虑。\n     <br>\n     <br>云云娇羞地说：我知道他有问题，但我不介意。你不知道，他不仅仅有钱，而且口才好、动手动力更强', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 4393, 49, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	('joke', 'qiushibaike', '120939313', '那年失恋，饭不思茶不想，感觉甚是难受，就连上个厕所，也是郁郁寡欢，只会哭得跟个泪人似的，脑子里恨不得想要把一切都忘掉，要不是从厕所出来时，室友笑嘻嘻地看着我，我还不知道，上完厕所，我连裤子都忘了提…', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1036, 28, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	('joke', 'qiushibaike', '120887702', '背痒痒让老婆挠一下，轻飘飘的挠半天还特么不过瘾，就说：轻了，轻了，再重一点。\n     <br>二货伸出手指，在我眼前直比划：看，老娘十指空空，能不轻吗？你要往上戴点啥，别说挠痒，给你挠出几道血印都做得到。\n     <br>不就是想戴点啥吗？我一狠心就买了个……痒痒挠', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1021, 16, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	('joke', 'qiushibaike', '120941526', '老婆跟女同事聊天，我在边上玩手机，就听她同事说要去买条安，全裤，老婆说，浪费，花那钱干嘛，你坐着蹲下人家都看不到，看到也全是肉，不信你问我老公，他说的', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1687, 29, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	('joke', 'qiushibaike', '120536325', '老板让我给她拿报销凭证，我想是要给新职员看嘛，我就拿了一个同事的过去了，老板说是凭证，我想看凭证干嘛啊，于是我又拿了本以前的凭证过去了，老板无奈的笑了笑举了一下单子，cnm，那难道不是费用报销单[哀怨]我也怀疑是我来大姨妈导致脑子不转弯[撞到玻璃', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 221, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
