	('JAVA软件工程师', '亚信软件CMC', '0.8-1.2万/月', 8000, 12000, '武汉-江汉区', '08-23', 'https://jobs.51job.com/wuhan-jhq/88812537.html?s=01&t=0', 'JAVA招聘\n专业要求：计算机\n工作职责：在项目中承担软件开发工作，根据设计文档或需求说明完成代码编写，调试，测试和维护，能解决开发中的问题。\n工作经验：至少1年以上JAVA开发工作经验，有电信行业开发经验者优先\n薪资范围：8K-12K\n知识技能：1、精通JAVA编程语言；熟悉HTML和CSS；熟悉SHH等主流开发框架；2、熟悉ORACLE、MySQL等数据库应用，能够编写和优化复杂的SQL程序；3、掌握电信行业业务规范，能较广泛地了解行业业务知识。\n综合素质：有团队合作精神，善于沟通，学习能力强，有抗压能力，\n公司福利：\n1、年底13薪+绩效奖金\n2、五险一金+补充医疗保险（门诊、大病等）\n3、每月定期举行Happy Day活动；\n4、部门每月优秀员工奖\n5、集团年度优秀员工奖\n工作地点：武汉市江汉经济开发区发展四路新金科技孵化园C座301\n我们诚邀优秀的你过来聊一聊~\n\n\n\n\n微信分享'),
