	('Java开发工程师—武汉', '亚信科技（中国）有限公司', '0.9-1.1万/月', 9000, 11000, '武汉', '08-23', 'https://jobs.51job.com/wuhan/103778174.html?s=01&t=0', '工作职责：\n1、在CRM项目中\n2、按计划完成功能模块的功能设计、代码实现,，代码编写和单元测试；\n3、能解决开发过程中出现的各种问题。\n\n任职资格：\n\n3. 具有良好需求分析、产品设计经验，良好的业务理解与讲解、沟通经验。\n\n综合素质/加分项：\n1.具有较强的快速学习能力，具备独立解决问题能力；\n2.有强烈的进取心,对新技术有钻研精神，富有激情，具有强烈的创新优化意识；\n3.具有较强的专业技术能力、逻辑思维能力、良好的表达能力；\n4.有良好的沟通能力、团队协作意识以及客户服务精神；\n5.有强烈的工作责任心与敬业精神，工作积极主动、认真负责，具备吃苦耐劳的精神和承受高强度、高压力的良好心理素质；\n\n\n\n\n\n\n\n微信分享'),
	('Java高级开发工程师、项目经理', '湖北央联信息技术有限公司', '1.5-2万/月', 15000, 20000, '武汉-江汉区', '08-23', 'https://jobs.51job.com/wuhan-jhq/105471604.html?s=01&t=0', '1、计算机专业，熟练阅读英文API，基\n2、具备4年以上JAVA开发经验，2年以上参与中大型企业应用开发经验；\n3、对各种开源的框架如Spring mvc、Spring、mybatis等有深入了解，有较强的源码研究理解能力优先；\n4、精通js，css,熟悉javascript面向对象编程；\n5、对 Redis、消息队列 有应用及研究经验优先；\n6、熟悉分布式系统的设计和应用，熟悉MongoDB等NoSQL数据库者优先；\n7、有大型网站设计架构开发、大并发访问量业务开发的经验者优先；\n8、有熟悉分布式架构建设，了解dubbo、spring cloud、spring boot等技术者优先。\n9、熟练使用linuxshell脚本、熟悉linux系统。\n10、对第三支付、微信公众号、小程序方面有经验者优先\n\n\n\n\n微信分享'),
	('Java开发工程师', '钜亿科技（深圳）有限公司', '0.6-1.2万/月', 6000, 12000, '武汉-东湖新技...', '08-23', 'https://jobs.51job.com/wuhan-dhxjs/105854791.html?s=01&t=0', '任职资格：\n1、计算机相关专业\n2、熟练掌握Oracle,SqlServer,MySQL等大型数据库一种或多种，熟练编写SQL语句及SQL优化；\n3、掌握JavaScript,CSS3,XML,AJAX,JQUERY等知识，能够灵活运用；\n4、对技术有激情，喜欢钻研，有较强的独立，主动的学习能力，良好的沟通表达能力和团队协作能力。\n\n\n\n\n微信分享'),
	('Java开发工程师', '建投数据科技股份有限公司', '1-1.5万/月', 10000, 15000, '武汉', '08-23', 'https://jobs.51job.com/wuhan/105841236.html?s=01&t=0', '基本要求\n2、3年以上工作经验；\n3、熟练掌握集JAVA一般主流框架前后台技术；\n4、熟悉掌握主流数据库（ORACLE，DB2，MySQL）和中间件（Tomcat，Websphere，Weblogic等）使用；\n5、有HR、CRM、OA等管理类型系统项目开发经验，能够与客户熟练沟通交流,，能出差；\n\n\n\n微信分享');
