	('daily', 'Daily ${.now?string[\'yyyy-MM-dd\']}', 'testwzd@163.com', '${cc}', '${bcc}', '<table border="1" cellspacing="0" cellpadding="20">\r\n	<tr bgcolor="blue" >   \r\n		<td><font color="white">Id</font></td><td><font color="white">Name</font></td><td><font color="white">Detail</font></td>  \r\n 	</tr>  \r\n	<#list contentList as it>   \r\n	<tr>   \r\n		<td>${it.id}</td><td>${it.name}</td><td>${it.detail}</td>  \r\n 	</tr>  \r\n	</#list>\r\n </table>');
INSERT INTO `sys_dao_t` (`module`, `demension`, `action`, `value`, `json_data`) VALUES
	('51Job', '', 'ra', 'select company as "company",\r\n	job as "job",\r\n	location as "location",\r\n	salary_start as "salaryStart",\r\n	salary_end as "salaryEnd",\r\n	detail as "detail"\r\nfrom job_t\r\nwhere salary_end<100000', NULL),
	('51job', '', 'truncate', 'truncate table job_t', NULL),
	('51job', '', 'us', 'insert into job_t(job,company,location,salary,salary_start,salary_end,create_date,url,detail)\r\nvalues\r\n<#list list as vo>\r\n	<#if vo_index gt 0>\r\n	,\r\n	</#if>\r\n	(\'${vo.job}\',\'${vo.company}\',\'${vo.location}\',\'${vo.salary}\',${vo.salaryStart?c},${vo.salaryEnd?c},\'${vo.createDate}\',\'${vo.url}\',\'${vo.detail}\')\r\n</#list>	', NULL),
	('51Job', 'company', 'ra', 'select company as "company",\r\n	avg((salary_start+salary_end)/2) as "salaryAvg",\r\n	max(salary_end) as "salaryMax"\r\nfrom job_t\r\nwhere salary_end<100000\r\n	and salary_end>=20000\r\ngroup by company\r\norder by salaryMax asc,avg((salary_start+salary_end)/2) asc', NULL),
	('51job', 'detail', 'strs', 'select detail from job_t', NULL),
	('51job', 'skill$dictCount', 'u', 'insert into job_skill_heat_t(text,c,salary_start,salary_end,salary_avg)\r\nvalues\r\n<#list list as vo>\r\n	<#if vo_index gt 0>\r\n	,\r\n	</#if>\r\n	(\'${vo.text}\',${vo.c?c},${vo.salaryStart?c},${vo.salaryEnd?c},${vo.salaryAvg?c})\r\n</#list>	', NULL),
	('51job', 'skill$dictionary', 'strs', 'select text from dictionary_t', NULL),
	('51Job', 'skillHeat', 'ra', 'select t2.category as "category",\r\n	t1.text as "text",\r\n	t1.c as "c",\r\n	t1.salary_start as "salaryStart",\r\n	t1.salary_end as "salaryEnd",\r\n	t1.salary_avg as "salaryAvg"\r\nfrom job_skill_heat_t t1\r\nleft join dictionary_t t2\r\n	on t1.text=t2.text\r\norder by t1.salary_start,t1.salary_end', NULL),
	('51Job', 'skillHeat$avg', 'ra', 'select t2.category as "category",\r\n	t1.text as "text",\r\n	t1.c as "c",\r\n	t1.salary_start as "salaryStart",\r\n	t1.salary_end as "salaryEnd",\r\n	t1.salary_avg as "salaryAvg"\r\nfrom job_skill_heat_t t1\r\nleft join dictionary_t t2\r\n	on t1.text=t2.text\r\norder by "salaryAvg",t1.salary_end\r\nlimit 1,20', NULL),
	('51Job', 'skillHeat$max', 'ra', 'select t2.category as "category",\r\n	t1.text as "text",\r\n	t1.c as "c",\r\n	t1.salary_start as "salaryStart",\r\n	t1.salary_end as "salaryEnd",\r\n	t1.salary_avg as "salaryAvg"\r\nfrom job_skill_heat_t t1\r\nleft join dictionary_t t2\r\n	on t1.text=t2.text\r\norder by t1.salary_end,t1.salary_start', NULL),
	('51Job', 'skillHeat$min', 'ra', 'select t2.category as "category",\r\n	t1.text as "text",\r\n	t1.c as "c",\r\n	t1.salary_start as "salaryStart",\r\n	t1.salary_end as "salaryEnd",\r\n	t1.salary_avg as "salaryAvg"\r\nfrom job_skill_heat_t t1\r\nleft join dictionary_t t2\r\n	on t1.text=t2.text\r\norder by t1.salary_start,t1.salary_end\r\nlimit 1,20', NULL),
	('51Job', 'skillHeat$truncate', 'u', 'delete from  job_skill_heat_t where 1=1', NULL),
	('ci', '', 'ra', 'SELECT id as "id",\r\n    parent_id as "parentId",\r\n    parent_id as "pid",\r\n    cn as "cn",\r\n    en as "en",\r\n    cn as "text",\r\n    index_id as "indexId",\r\n    url as "url",\r\n    detail as "detail"\r\nFROM sys_Menu_t\r\nwhere is_active=\'Y\'', NULL),
	('cmd', 'module', 'ra', 'select id as "id",\r\n	concat(cn,"(",id,")") as "text"\r\nfrom sys_menu_t\r\nwhere parent_id is null\r\norder by cn', NULL),
	('dao', '', 'ds', 'delete from sys_dao_t\r\nwhere (module,demension,action) in(\r\n<#list list as vo>\r\n	<#if vo_index gt 0>\r\n	,\r\n	</#if>\r\n	(\'${(vo.module)!}\',\'${(vo.demension)!}\',\'${(vo.action)!}\')\r\n</#list>	\r\n)', NULL),
	('dao', '', 'ra', 'select module as "module",\r\n	demension as "demension",\r\n	action as "action",\r\n	value as "value",\r\n	json_data as "jsonData"\r\nfrom sys_dao_t', NULL),
	('dao', '', 'us', 'replace into sys_dao_t(module,demension,action,value,json_data)\r\nvalues\r\n<#list list as vo>\r\n	<#if vo_index gt 0>\r\n	,\r\n	</#if>\r\n	(\'${(vo.module)!}\',\'${(vo.demension)!}\',\'${(vo.action)!}\',\'${(vo.value)!}\',\'${(vo.jsonData)!}\')\r\n</#list>	', NULL),
	('gridSchema', '', 'str', 'SELECT json_data\r\nFROM sys_lookupitem_t\r\nwhere type_id=\'grid\'\r\n	and id=\'${gid}\'', NULL),
	('health', 'weight', 'ra', 'select log_date as "logDate",\r\n	value as "value",\r\n	bmi as "bmi"\r\nfrom health_weight_v\r\norder by log_date', NULL),
	('house', '', 'truncate', 'truncate table house_t', NULL),
	('house', '', 'us', 'insert into house_t(location,area,cost,design,build_year,floor,floors,detail,url)\r\nvalues\r\n<#list list as vo>\r\n	<#if vo_index gt 0>\r\n	,\r\n	</#if>\r\n	(\'${vo.location}\',${vo.area?c},${vo.cost?c},\'${vo.design}\',\'${vo.buildYear}\',\'${vo.floor}\',\'${vo.floors}\',\'${vo.detail}\',\'${vo.url}\')\r\n</#list>', NULL),
	('house', 'all', 'ra', 'select location as "location",\r\n	area as "area",\r\n	cost as "cost",\r\n	floor as "floor",\r\n	floors as "floors",\r\n	detail as "detail"\r\nfrom house_t\r\nwhere area<250', NULL),
	('house', 'location', 'ra', 'select text as "text",\r\n	c as "c"\r\nfrom house_location_heat_t\r\norder by c asc', NULL),
	('house', 'location', 'strs', 'select location from house_t', NULL),
	('house', 'location$heat', 'u', 'insert into house_location_heat_t(text,c)\r\nvalues\r\n<#list list as vo>\r\n	<#if vo_index gt 0>\r\n	,\r\n	</#if>\r\n	(\'${vo.text}\',${vo.c?c})\r\n</#list>	', NULL),
	('house', 'location$heat$truncate', 'u', 'truncate table house_location_heat_t', NULL),
	('house', 'map', 'ra', 'select location as "location",\r\n	area as "area",\r\n	cost as "cost",\r\n	floor as "floor",\r\n	floors as "floors",\r\n	detail as "detail"\r\nfrom house_t\r\nwhere area<250\r\n	and location like \'%武%\'', NULL),
	('house', 'target', 'ra', 'select location as "location",\r\n	area as "area",\r\n	cost as "cost",\r\n	floor as "floor",\r\n	floors as "floors",\r\n	detail as "detail",\r\n	url as "url"\r\nfrom house_t\r\nwhere area<=120\r\n	and area>=105\r\n	and cost<=150\r\n	and location like \'%武%\'', NULL),
	('io', 'month', 'ra', 'select * \r\nfrom io_month_v\r\norder by month', NULL),
	('io', 'year', 'ra', 'select * \r\nfrom io_year_v\r\norder by year', '[{\r\n	"col":"year",\r\n	"name":"年份"\r\n},{\r\n	"col":"demand",\r\n	"name":"需求"\r\n},{\r\n	"col":"supply",\r\n	"name":"供应"\r\n},{\r\n	"col":"gap",\r\n	"name":"缺口"\r\n},{\r\n	"col":"gaps",\r\n	"name":"累计缺口"\r\n}]'),
	('joke', 'qiushibaike', 'ra', 'select s0 as \'id\',\r\n	max(s1) as \'contents\',\r\n	max(v1) as \'thumbs\',\r\n	max(v2) as \'comments\'\r\nfrom bigdata_t\r\nwhere type_id=\'joke\'\r\ngroup by s0', NULL),
	('joke', 'qiushibaike', 'truncate', 'delete from bigdata_t\r\nwhere type_id=\'joke\'\r\n	and src=\'qiushibaike\'', NULL),
	('joke', 'qiushibaike', 'us', 'insert into bigdata_t(type_id,src,s0,s1,v1,v2)\r\nvalues\r\n<#list list as vo>\r\n	<#if vo_index gt 0>\r\n	,\r\n	</#if>\r\n	(\'joke\',\'qiushibaike\',\'${vo.id}\',\'${vo.content}\',${vo.thumbs?c},${vo.comments?c})\r\n</#list>	', NULL),
	('joke', 'thumbsHeat', 'ra', 'select s0 as \'id\',\r\n	s1 as \'text\',\r\n	v1 as \'c\'\r\nfrom bigdata_t t1\r\nwhere type_id=\'joke\'\r\n	and v1>(select avg(v1) from bigdata_t where type_id=\'joke\')*0.3', NULL),
	('joke', 'thumbsHeat$cloud', 'ra', 'select s0 as \'text\',\r\n	v0 as \'c\'\r\nfrom bigdata_t\r\nwhere type_id=\'joke$thumbsHeat$cloud\'', NULL),
	('joke', 'thumbsHeat$cloud', 'truncate', 'delete from bigdata_t\r\nwhere type_id=\'joke\'\r\n	and src=\'joke$thumbsHeat$cloud\'\r\n', NULL),
	('joke', 'thumbsHeat$cloud', 'us', 'insert into bigdata_t(type_id,s0,v0)\r\nvalues\r\n<#list list as vo>\r\n	<#if vo_index gt 0>\r\n	,\r\n	</#if>\r\n	(\'joke$thumbsHeat$cloud\',\'${vo.text}\',${vo.c?c})\r\n</#list>	', NULL),
	('joke', 'top', 'ra', 'select s0 as \'id\',\r\n	max(s1) as \'contents\',\r\n	max(v1) as "thumbs",\r\n	max(v2) as \'comments\'\r\nfrom bigdata_t\r\nwhere type_id=\'joke\'\r\n	and s1 not like \'%img%\'\r\ngroup by s0\r\norder by v1 desc\r\nlimit 1,10', NULL),
	('log', '', 'us', 'insert into log_t(type_id,c_time,c_user,name,detail)values<#list list as vo>	<#if vo_index gt 0>	,	</#if>	(\'${(vo.typeId)!}\',now(),\'\',\'${(vo.name)!}\',\'${(vo.detail)!}\')</#list>	', '21'),
	('lookup', '', 'ra', 'SELECT id,\r\n	en,\r\n	cn,\r\n	value,\r\n	detail,\r\n	attr1,\r\n	attr2,\r\n	attr3,\r\n	attr4,\r\n	attr5,\r\n	attr6\r\nFROM Lookup_t\r\nwhere type_id=${typeId}', NULL),
	('lookupType', '', 'ra', 'select id,\r\n	cn,\r\n	en,\r\n	detail\r\nfrom sys_lookuptype_t', NULL),
	('menu', '', 'ra', 'SELECT id as "id",\r\n    parent_id as "parentId",\r\n    parent_id as "pid",\r\n    cn as "cn",\r\n    en as "en",\r\n    cn as "text",\r\n    index_id as "indexId",\r\n    url as "url",\r\n    detail as "detail"\r\nFROM sys_Menu_t\r\nwhere is_active=\'Y\'', NULL),
	('menuTree', '', 'querys', 'SELECT id as "id",\r\n    parent_id as "parentId",\r\n    parent_id as "pid",\r\n    cn as "cn",\r\n    en as "en",\r\n    cn as "text",\r\n    index_id as "indexId",\r\n    url as "url",\r\n    detail as "detail"\r\nFROM sys_Menu_t\r\nwhere\r\n<#if id?? && id!=\'\'>\r\n    parent_id =\'${id}\'\r\n<#else>\r\n    parent_id is null or parent_id=\'\'\r\n</#if>\r\n	and is_active=\'Y\'\r\norder by index_id', NULL),
	('notebook', 'income$company', 'ra', 'select s1 as \'company\',\r\n	sum(v2*v3) as \'income\'\r\nfrom bigdata_t\r\nwhere type_id=\'notebook\'\r\ngroup by s1\r\norder by sum(v2*v3)', NULL),
	('notebook', 'income$shopAvg', 'ra', 'select s1 as \'company\',\r\n	sum(v2*v3)/sum(v1) as \'income\'\r\nfrom bigdata_t\r\nwhere type_id=\'notebook\'\r\ngroup by s1\r\norder by sum(v2*v3)/sum(v1)', NULL),
	('notebook', 'price$company', 'ra', 'select s1 as \'company\',\r\n	sum(v1) as \'sellNum\',\r\n	sum(v2*v3)/sum(v3) as \'price\',\r\n	sum(v3) as \'monthSales\'\r\nfrom bigdata_t\r\nwhere type_id=\'notebook\'\r\ngroup by s1', NULL),
